!     the array absb(1175,NG04) = kb(9,5,13:59,NG04) contains absorption
!     coefs for each of the NG04=16 g-intervals for a range of pressure
!     levels  < ~100mb, temperatures, and ratios of h2o to co2.  the first
!     index in the array, js, runs from 1 to 9, and corresponds to
!     different gas column amount ratios, as expressed through the binary
!     species parameter eta, defined as eta = gas1/(gas1+rat*gas2), where
!     rat is the ratio of the reference MLS column amount value of gas1
!     to that of gas2. the second index, jt, which runs from 1 to 5,
!     corresponds to different temperatures.  more specifically, jt = 1-5
!     means that the data are for the corresponding temperature of tref-30,
!     tref-15, tref, tref+15, and tref+30, respectively.  the third index,
!     jp, runs from 13 to 59 and refers to the corresponding pressure
!     level in pref (e.g. jp = 13 is for a pressure of 95.5835 mb).
!     the fourth index, ig, goes from 1 to NG04=16, and tells us which
